data.value:
Укажите формат именования объектов в формате handlebars, с указанием аргументов в двойных фигурных скобках, где аргументы:
{{n}} - номер;
{{displayname}} - отображаемое имя;

Используемые переменные: {{n}} - номер; {{displayname}} - отображаемое имя;
Используемые функции: {{lz number data}} - добавить (number) ведущих нулей к (data) {{lz 5 n}} = 00777
{{fst number data}} - взять первые (number) символов (data) {{fst 4 displayname}} = иван [ов иван иванович]
{{trans data}} - транслитерация в латинский алфавит {{trans displayname}} = ivanov ivan ivanovich
{{split 2 displayname}} = александрович
Комбинации: {{fst 1 (trans (split 1 displayname))}}.{{trans (split 0 displayname)}}
